import React, { Component } from 'react';
import PROJECTS from './asset/data/projects';
class Project extends Component {
    constructor(props) {
        super(props);
        this.state = {  };
    }
    render() {
        return (
            <div>
                <h1>HIghLIghted Project</h1>
                <div>
                    {PROJECTS.map(prod=>{
                        return(
                            <div>
                                {prod.title}
                            </div>
                        )
                    })}
                </div>
            </div>
            
        );
    }
}

export default Project;
